import React from 'react'

const Login = () => {
    const handleSubmit = async (e) =>{
        e.preventDefault()
        const response = await fetch("http://localhost:4000/api/auth/login", {
            method: 'POST',
            headers: {
              'content-Type': 'application/json',
              'auth-token': "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJ1c2VyIjp7ImlkIjoiNjRlYzNmYTc3ZDU2M2YwNTU2YTRhMTk1In0sImlhdCI6MTY5MzIwNDQ3NH0.Sv7_YgEwG9j1enxUUoDCyewplVr1lbjsZBBFCjFFWjM"
            }
          });
    }
    return (
        <div>
            <form>
                <div class="mb-3">
                    <label for="email" class="form-label">Email address</label>
                    <input type="email" class="form-control" id="email" name='email' aria-describedby="emailHelp"/>
                        <div id="emailHelp" class="form-text">We'll never share your email with anyone else.</div>
                </div>
                <div class="mb-3">
                    <label for="password" class="form-label">Password</label>
                    <input type="password" class="form-control" id="password" name='password'/>
                </div>
                <button type="submit" class="btn btn-primary" onSubmit={handleSubmit} >Submit</button>
            </form>
        </div>
    )
}

export default Login
